1) che siap salvi, riservati e rispettati i diritti di terzi, e l'osser- vanza della legge e regolamenti in materia;
2) di fabbrica non deve mai ingombrare le vie, gli spazi pubblici adia- centi alle fabbriche e deve osservare tutte le cautele atte a rimuo- vere ogni pericolo di danno a persone e cose ed assicurare per quanto è possibile gli incomodi che i terzi possono risentire della esecuzio ne di tali opere;
3) il luogo destinato all'opera deve essere chiuso con assito lungo i la ti prospicenti le vie o spazi pubblici ;!
gli assiti od altri ripari devono essere coloriti con fasce alternate bianche e rosse agli angoli salienti, a tutta altezza, e muniti pure agli angoli da una lanterna a vetri rossi da mantenersi accesa dal tramonto al levar del solen secondo l'intero orario della pubblica il luminazione stradale. Questa lanterna deve essere collocata in modo ed avere dimensioni tali, da rendere facilmente visibili il recinto od ilreparto su cui è collocata;
4) per eventuali occupazioni di aree stradali si deve ottenere speciale autorizzazione comunale. Le aree così occupate devono essere restitui te nel pristino stato, a lavoro ultimato o anche prima su richiesta dell'Ufficio Tecnico Comunale, nel caso che la costruzione venisse ab bandonata o sospesa oltre un certo tempo;
5) se nel manomettere il suolo pubblico il costruttore incontrasse manu- fatti per servisio pubblico, deve usare ogni cautela per non danneg- gianli e deve contemporaneamente darne avviso alle imprese proprieta- rie nonchè all'Ufficio Tecnico Comunale, per i provvedimenti del caso;
6) l'Amministrazione Comunale si riserva le tasse specili e gli eventua li canoni, precari, ecc. che risultassero applicabili ad opere ultima te a tenore dei relativi regolamenti;
7) dovranno venire osservati gli adempimenti previsti dalla Legge 5.11.1971 nº 1086 concernente le norme per la displina delle opere di conglome- rato in c.a. normale e precompresso ed a struttura metallica, nonchè le disposizioni di cui al D.M. 1.12.1975 recante "Norme di sicurezza per apparecchi conteneti liquidi caldi sotto pressione" e quelle di cui alla Legge 30.4.1976 nº 373 recante "Norme per il contenimento del con sumo energetico per usi termici negli edifici";
